import Vue from 'vue'
import VueRouter from 'vue-router'
import Home from './components/Home'
import Student from './components/Student'
import CharIndex from './components/ChatIndex'
import ChartRoom from './components/ChatRoom'

Vue.use(VueRouter)

const routes = [
  {
    path: '/',
    component: Home,
    name: 'Home'
  },
  {
    path: '/student',
    component: Student,
    name: 'Student'
  },
  {
    path: '/chartindex',
    component: CharIndex,
    name: 'CharIndex'
  },
  {
    path: '/chartroom',
    component: ChartRoom,
    name: 'ChartRoom'
  }
]

const router =  new VueRouter({
  routes
})

export default router
